import React from "react";
import { NavLink } from "react-router-dom";

const navBar = () => {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <NavLink to="/first">First Interface</NavLink>
          </li>
          <li>

            <NavLink to="/second">Second Interface</NavLink>
          </li>
          <li>
            <NavLink to="/third">Third Interface</NavLink>
          </li>
          <li>
            <h1>hello 4</h1>
            <NavLink to="/forth">Forth Interface</NavLink>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default navBar;
